import React from 'react'
import * as FiIcons from "react-icons/fi";

export const SidebarData = [
    {
        title: "Home",
        icon: <FiIcons.FiHome/>,
        link: "/home"
    },
    {
        title: "Wallet",
        icon:  <FiIcons.FiDollarSign/>,
        link: "/home"
    },
    {
        title: "Portfolio",
        icon: <FiIcons.FiActivity/>,
        link: "/home"
    },


]
